import React from 'react';
import { Link } from 'react-router-dom';
import styles from '../styles/Projects.module.css';

function Projects() {
  const projects = [
    {
      id: 1,
      name: 'Project 1',
      description: 'This is a description of Project 1.',
      image: 'path/to/image1.jpg'
    },
    {
      id: 2,
      name: 'Project 2',
      description: 'This is a description of Project 2.',
      image: 'path/to/image2.jpg'
    },
    {
      id: 3,
      name: 'Project 3',
      description: 'This is a description of Project 3.',
      image: 'path/to/image3.jpg'
    },
    {
      id: 4,
      name: 'Project 4',
      description: 'This is a description of Project 4.',
      image: 'path/to/image4.jpg'
    },
    {
      id: 5,
      name: 'Project 5',
      description: 'This is a description of Project 5.',
      image: 'path/to/image5.jpg'
    },
    {
      id: 6,
      name: 'Project 6',
      description: 'This is a description of Project 6.',
      image: 'path/to/image6.jpg'
    },
    {
      id: 7,
      name: 'Project 7',
      description: 'This is a description of Project 7.',
      image: 'path/to/image7.jpg'
    },
    {
      id: 8,
      name: 'Project 8',
      description: 'This is a description of Project 8.',
      image: 'path/to/image8.jpg'
    },
    {
      id: 9,
      name: 'Project 9',
      description: 'This is a description of Project 9.',
      image: 'path/to/image9.jpg'
    }
  ];

  return (
    <div className={styles.projects}>
      {projects.map((project, index) => (
        <Link key={index} to={`/projects/${project.id}`} className={styles.project}>
          <img src={project.image} alt={project.name} />
          <p>{project.description}</p>
        </Link>
      ))}
    </div>
  );
}

export default Projects;
